(1463, '102', 1530521, 'TRANSITO  SANCHEZ MONSERRAT', 'QUIMICA I', 'ITZEL URIBE ARIZMENDI', 4, 4, 3, 3, 3, 4, 3, 4, 4, 3, 4, 4, 3, 3, 3, 4, 3, 4, 3, 4, 3, 4, 4, 4, 3, 3, 3, 4, 3, 4, 'El profesor de quimica es un maestro que no prepara muy bien su clase, si sabe de lo que esta hablando, pero no sabe expresarlo con sus alumnos, se revuelve con sus ideas, tiene los conocimientos, pero como docente no se desenvuelve bien.\r\n											', 1),
