(1483, '102', 1530520, 'DIAZ FARILL RODOLFO', 'ORIENTACION EDUCATIVA I', 'JOSE ANTONIO BRITO SOLIS', 4, 4, 4, 4, 3, 4, 4, 4, 3, 4, 4, 3, 4, 4, 4, 4, 4, 4, 4, 4, 3, 4, 3, 4, 4, 4, 4, 4, 4, 4, '											-El Profesor Brito en mi opinion es el mejor maestro que hay en la Loyola por que aparte de encaminarte en un buen camino el te da consejos y te ayuda, al mimo tiempo que simpre participa en diversas divertidas actividades.', 1),
(1484, '102', 1530572, 'BAHENA SOTO ANDREA', 'MATEMATICAS I', 'MONICA LOPEZ DE LA CRUZ ', 3, 3, 2, 1, 2, 2, 1, 1, 4, 4, 2, 4, 2, 2, 3, 2, 3, 1, 3, 2, 2, 3, 2, 2, 2, 3, 2, 3, 4, 3, 'En mi opinión la profesora Mónica sabe muchas cosas, pero no enseña como debería.\r\nDebe mejorar su actitud junto con la manera en que se dirige a nosotros, que sea mas flexible a la hora de las dudas, que sea mas educada con nosotros, porque nos contesta de mala manera y no nos deja terminar de hablar a veces y hasta nos ignora.\r\nDebería repasar mas los temas porque a veces si son un poco complejos.\r\nDebe cambiar su manera de evaluar ya que a mi parecer los cuartos, medios etc; de firma no me parecen. \r\n				', 1),
