INSERT INTO `cuestionario_prepa` (`id`, `grupo`, `matricula`, `alumno`, `materia`, `profesor`, `p1`, `p2`, `p3`, `p4`, `p5`, `p6`, `p7`, `p8`, `p9`, `p10`, `p11`, `p12`, `p13`, `p14`, `p15`, `p16`, `p17`, `p18`, `p19`, `p20`, `p21`, `p22`, `p23`, `p24`, `p25`, `p26`, `p27`, `p28`, `p29`, `p30`, `observaciones`, `status`) VALUES
(1526, '102', 1530544, 'VALENCIA MEJIA EVELYN GEORGINA', 'QUIMICA I', 'ITZEL URIBE ARIZMENDI', 2, 2, 2, 3, 3, 3, 1, 3, 2, 1, 3, 3, 2, 2, 2, 2, 2, 2, 1, 1, 2, 2, 1, 3, 2, 2, 1, 1, 3, 3, 'Mi profesor, Julio César, no es mi favorito, tengo algunas inconformidades:\r\n1.-No tiene mucha tolerancia respecto a la hora de llegada y si no estas en la clase, cuando intentas entregar los trabajos, no los acepta.\r\n2.-Cuando entras a la clase no nos permite salir por ninguna razón (sólo en algunas ocasiones, como para ir al baño o los directivos llaman a alguien) hasta que tenemos nuestros 10 minutos de receso, aun incluso si alguien sale para buscar el libro de química, no  te permite salir\r\n3.-No nos explica los temas con claridad, no damos repasos, y al momento de resolver dudas es muy confuso.\r\n4.- Los temas que nos enseña no son exactamente los que deberíamos ver.\r\n5.- La maestra Itzel explica los temas de manera más comprensible y si nos permite entrar a su clase aunque ella no nos da clases (fue mi caso cuando el profesor Julio no me permitió entrar por unos segundos de retraso).\r\n', 1),
(1527, '503', 1330356, 'SOTELO LOPEZ ERICK RODRIGO', 'LENGUA ADICIONAL AL ESPANOL V', 'RODOLFO TILO MENDEZ ORTIZ', 2, 3, 2, 4, 4, 3, 3, 1, 1, 1, 1, 3, 4, 2, 3, 2, 2, 3, 2, 2, 3, 3, 2, 2, 3, 3, 3, 3, 3, 1, '											', 1),
(1528, '302', 1430459, 'GOMEZ BAUTISTA LIZETH', 'GEOGRAFIA', 'PEDRO ANTONIO NAVA AGUILERA', 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 2, 3, 3, 3, 'La materia de Geografía no tiene tutorías como tal, más sin embargo cada que tengo alguna duda, le envío un correo electrónico al profesor y me orienta y resuelve mis dudas. 	', 1),
(1529, '102', 1530564, 'NUNEZ MEDINA XIANDANI', 'MATEMATICAS I', 'MONICA LOPEZ DE LA CRUZ ', 2, 3, 1, 1, 4, 1, 1, 1, 4, 1, 1, 4, 4, 2, 4, 3, 3, 2, 3, 4, 2, 3, 3, 4, 2, 3, 3, 3, 1, 1, '	debería tener mas paciencia con el grupo, explicar mejor y también siempre que le preguntas algo no te quiere explicar y cuando te vuelve a explicar lo hace de muy mala gana y algunas veces sus respuestas es un poco grosera.									', 1),
