(1548, '102', 1530571, 'TELLEZ  PAZ Y PUENTE CASSANDRA ANAID', 'QUIMICA I', 'ITZEL URIBE ARIZMENDI', 2, 2, 3, 2, 3, 2, 1, 2, 1, 1, 1, 3, 2, 1, 2, 2, 2, 2, 1, 2, 2, 2, 1, 1, 2, 1, 2, 2, 3, 2, 'Mi profesor de química (Julio César) no es el mejor que digamos y quisiera externar varias de mis inconformidades con respecto a su forma de enseñar.\r\n*Primero que nada hay algo que casi desde el comienzo de las clases comenzó a implementar, y era que tenía 0 tolerancia con los retrasos en clase. Me refiero a que si uno llegaba tan sólo 3 segundos después de que el pusiera un pie dentro del salón te sacaba, y aparte no te recibía los trabajos después de eso. Esto me ha sucedido como 2 o 3 veces en todo el semestre, aunque al final termino entrando a la clase de la profa Itzel y acabo aprendiendo más en esa clase que en la mía.\r\n *Otro problema es que está más que visto que lo que él nos enseña no es exactamente lo que deberíamos de ver. Por ejemplo, con el tema de los tipos de métodos para las nomenclaturas, el profesor sólo llegó a mencionarnos  de ellas en una clase, y después sólo vimos la tradicional, nunca aprendimos de las otras dos, a diferencia de la profa Itzel que sólo les da a los del 101, a ellos si les enseñaron bien el tema con todo y ejercicios al respecto (lo sé por una de las clases que llegué a tomar cuando me llegaban a sacar de clase). Y pues no considero que eso sea justo ya que no aprendemos lo que deberíamos de saber y eso luego nos afecta en los examenes departamentales.\r\n *Tampoco hemos hecho repasos antes de los examenes, ni nos da guías o algo parecido sobre lo que podría venir en el examen. \r\n*Otra cosa también es que en sus productos, nunca los explica bien o no se atiende a lo que debería respecto con la rúbrica. Por ejemplo con el producto de las reacciones de este parcial. Se suponía que el profesor solamente nos daría una reacción química (fórmula) y nosotros tendríamos que balancearla, determinar el tipo de reacción (que por cierto jamás vimos ese tema a diferencia del 101 que si lo vieron), los nombres de los compuestos en stock (cosa que tampoco vimos) etc. Pero el profe encima de que nunca vimos eso, también quiso que hicieramos el experimento de la reacción, hacer una práctica ¡¡y cobrarnos 150 pesos a cada uno por los materiales!! Al final, tan mal estabamos en el tema del balanceo que hasta la misma profa Itzel nos ayudó a balancearla a mi compañero Carlos y a mi, y se tardó más de 1 hora en podernos ayudar por lo complejo que estaba la fórmula (que nosotros mismo tuvimos que investigar). \r\n*Y por último, ya para concluir con todas mis molestias con el profe. Una vez que fuimos al laboratorio para realizar una práctica, no nos avisó que ibamos a usar el libro y yo lo deje en el salón. Cuando llegué al laboratorio y me di cuenta de mi error fui con el profe a pedirle permiso para ir por él y poderle hacer la práctica, pero no me dejó y cuando le pregunte si entonces me dejaba entregarselo más al rato me dijo que no, que porque no había traído mi libro. \r\nSinceramente admito que el maestro sabe mucho, pero no nos enseña lo que debíamos de aprender, es muy radical con sus "castigos", y por lo que yo me he dado cuenta y me han dicho también suele ser muy llevado o maneja dobles sentidos con las alumnas. \r\nGracias por su atención Prepa Loyola :) ', 1),
(1549, '302', 1430459, 'GOMEZ BAUTISTA LIZETH', 'INTRODUCCION AL DISENO GRAFICO', 'RAFAEL ROMULO MORALES', 4, 3, 2, 2, 3, 3, 1, 2, 2, 2, 2, 4, 4, 4, 3, 4, 4, 4, 2, 3, 3, 4, 4, 4, 2, 3, 3, 3, 3, 3, '- Las clases de introducción al diseño gráfico siempre me tocan a primera hora, y como tenemos diez minutos de tolerancia se supone que después de esos diez minutos uno ya no podrá pasar, hubo como dos veces que llegue exactamente un minuto tarde y no me dejo pasar, eso se me hizo una "ridiculez". \r\n\r\n- Obviamente como todos tenemos dudas, se acercaba a todos los alumnos a aclararlas, pero hay veces en que se tarda demasiado con tan solo un alumno y ya no le da tiempo de ayudar a los demás en este caso, a mi	y se molesto porque no le entregué el trabajo como debía. 										', 1),
(1550, '302', 1430427, 'AGUIRRE HERNANDEZ JOSE CARLOS', 'LENGUA ADICIONAL AL ESPANOL III', 'RODOLFO TILO MENDEZ ORTIZ', 2, 2, 3, 4, 4, 4, 4, 3, 3, 2, 4, 4, 4, 4, 3, 4, 4, 4, 2, 3, 4, 3, 2, 3, 3, 1, 4, 3, 3, 1, 'Es mala onda a veces. Otras veces es buena onda, pero sin duda las calificaciones no reflejan mi nivel de inglés.', 1),
