(1761, '301', 1430438, 'SOTO TABAREZ SERGIO', 'LENGUA ADICIONAL AL ESPANOL III', 'RODOLFO TILO MENDEZ ORTIZ', 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, '											', 1),
(1762, '301', 1430438, 'SOTO TABAREZ SERGIO', 'LITERATURA I', 'MARTHA LUZ PINZON OCHOA', 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 'Su clase es perfecta pero deja mucho trabajo como la novela de 20 cuartillas 				', 1),
(1763, '302', 1430508, 'CALIXTO JIMENEZ GLORIA CITLALI', 'FISICA I', 'JOSE ANGEL BARRIENTOS OLEA', 3, 1, 3, 3, 3, 3, 1, 3, 2, 2, 3, 3, 3, 3, 3, 3, 3, 3, 3, 2, 3, 1, 2, 1, 2, 3, 2, 3, 1, 3, 'En general reconozco que es un profesor que conoce su área, sin embargo como recomendación diría que no basta con que el profesor conozca, si no mas bien lo sepa transmitir a sus alumnos, tendría que encontrar la forma para generar en sus alumnos el aprendizaje; los problemas con los que enseña y los que pone en el examen se deberían semejar y no dispararse tanto en los ejercicios del examen a comparación del nivel de complejidad que nos enseña en clase, dar las herramientas sólida sería buena opción. Reconozco que el nivel de complejidad que impone el profesor es de gran ayuda, pues nos hace competitivos, sin embargo creo que habría cosas que deberían mejorarse con la finalidad de que en todos los aspectos se cumpla el conocimiento avanzado en los alumnos. ', 1),
(1764, '302', 1430508, 'CALIXTO JIMENEZ GLORIA CITLALI', 'GEOGRAFIA', 'PEDRO ANTONIO NAVA AGUILERA', 3, 3, 4, 3, 3, 4, 3, 4, 3, 3, 2, 3, 3, 4, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 4, 3, 3, 3, 3, 3, 'No tengo más que respeto hacia él como profesor, me gusta mucho su forma de impartir la clase, habla con mucha seguridad acerca de la información que nos transmite, es abierto en cuanto a las opiniones y nos da ejemplos de la vida real para que los temas sean mas comprensibles y el grupo pueda retener la atención hacia él. No se cierra solamente a los temas establecidos. Me agrada mucho que sea él quien imparta la clase, la información no solo me queda como conocimiento, si no como aprendizaje.						', 1),
(1765, '302', 1430508, 'CALIXTO JIMENEZ GLORIA CITLALI', 'HISTORIA DE MEXICO II', 'GENARO PERALTA CARRERA', 3, 3, 3, 3, 3, 3, 3, 2, 3, 3, 2, 3, 3, 3, 3, 3, 3, 3, 3, 4, 3, 3, 3, 3, 4, 3, 3, 3, 3, 3, 'Me gusta mucho la forma en la que imparte su clase, en el grupo se genera inclusión, así se logró el objetivo, aprender mediante la forma dinámica en la que imparte su clase. Sinceramente sí me gustaría volver a tener clases con él. 				', 1),
(1766, '302', 1430508, 'CALIXTO JIMENEZ GLORIA CITLALI', 'INTRODUCCION AL DISENO GRAFICO', 'RAFAEL ROMULO MORALES', 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 2, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 'Es un profesor muy centrado y objetivo, me agrada saber que quien me transmite el conocimiento y aprendizaje es una persona centrada y profesionista. 			', 1),
(1767, '302', 1430508, 'CALIXTO JIMENEZ GLORIA CITLALI', 'LENGUA ADICIONAL AL ESPANOL III', 'RODOLFO TILO MENDEZ ORTIZ', 3, 3, 3, 3, 3, 4, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 4, 3, 3, 3, 3, 3, 'Es muy buen profesor, conoce y ejerce el término de maestro, no es cerrado ante ninguna situación, y se lleva muy bien con los alumnos. Me gusta mucho su clase. ', 1),
(1768, '302', 1430508, 'CALIXTO JIMENEZ GLORIA CITLALI', 'LITERATURA I', 'MARTHA LUZ PINZON OCHOA', 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 2, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 'Su figura de imponer respeto ante los alumnos considero que no debería tener nada que ver con generar miedo en ellos, al contrario, es importante la confianza entre alumno-profesor con el objetivo de que el estudiante se le pueda presentar de forma segura para la aclaración de sus dudas, quizá la forma cerrada en su actuar sea lo que genera estas actitudes en los alumnos, pero en lo general me gusta mucho que sepa transmitir sus conocimientos de forma objetiva. ', 1),
(1769, '302', 1430508, 'CALIXTO JIMENEZ GLORIA CITLALI', 'MATEMATICAS III', 'VALENTIN LEZAMA DOMINGUEZ', 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 2, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 'Me encanta muchísimo su clase porque da ejemplos para cada caso que se nos pueda presentar dentro de los temas de los cursos de matemáticas, además que no solo fomenta la parte práctica,si no también la teórica.									', 1),
(1770, '302', 1430508, 'CALIXTO JIMENEZ GLORIA CITLALI', 'ORIENTACION EDUCATIVA III', 'ANDREA CAMPOS FERNANDEZ', 1, 1, 1, 3, 3, 3, 2, 1, 1, 2, 4, 2, 2, 1, 2, 3, 3, 3, 3, 3, 3, 3, 3, 3, 1, 3, 3, 3, 3, 3, 'Me incomoda mucho la forma en la que imparte su clase, si así se le puede llamar, porque solo llega de manera impuntual a la clase y solo a escribir en el pizarrón "leer, subrayar y contestar las siguientes páginas..." este aspecto sinceramente me conflictua muchísimo, aceptaba hacer lo que se me era impuesto, pero quería y esperaba más de la materia para poder comprender de una manera más amplia el tema; no es eso lo que yo esperaba de una clase en una escuela de sumo prestigio, sé que categóricamente se debe corregir este aspecto.  En todo el curso de Orientación Educativa no hubo una sola vez de explicación de algún tema por parte de ella, y lo que considero más mediocre del caso, a la hora de entregar los productos y forma de evaluación se quería poner exigente, cuando ni siquiera nos había dado herramientas para la complejidad de sus productos. Pese a que entregábamos los trabajos en tiempo y forma y pese a que ella no daba ni explicaba su clase teníamos que aceptar su impuntualidad también en la entrega de calificaciones. 		', 1),
